import { TComponentGroup } from "~/interfaces/material_components";

const componentGroup: TComponentGroup = {
  iconType: "user",
  title: "Navigation",
  components: [
    { title: "Bottom Navigation", props: [] },
    { title: "Breadcrumbs", props: [] },
    { title: "Drawer", props: [] },
    { title: "Link", props: [] },
    { title: "Menu", props: [] },
    { title: "Stepper", props: [] },
    { title: "Tabs", props: [] }
  ]
};

export default componentGroup;
